import './projets.css'

function Projets() {
    return (
        <section id="projets">
          <h2>Projets réalisé durant l'année</h2>
          <ul>
            <li>Minishell2</li> 
            <li>My_RPG</li>
            <li>Need4Stek</li>
            <li>My_Sokoban</li>
            <li>Pong</li>
            <li>Portfolio</li>
            <li>Bot Discord</li>
          </ul>
        </section>
    );
}

export default Projets;
